  false,\n\t\"url\": null,\n\t\"notes\": \"The 2004 U.S. Landfalling Hurricanes poster
  is a special edition poster which contains two sets of images of Hurricanes Charley,
  Frances, Ivan, and Jeanne, created from NOAA's operational satellites. In addtion
  to the images, the poster has a map depicting the general track of each storm; information
  on each storm's landfall location, date of landfall, and category level at time
  of landfall; as well as, a Saffir-Simpson Hurricane Scale chart. Poster size is
  34\"x27\".\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
